import React from 'react';
import { AppBar, Toolbar, Typography, Button, Container, Menu, MenuItem } from '@mui/material';
import { Link } from 'react-router-dom';

const Header = () => {
  const [anchorElServices, setAnchorElServices] = React.useState(null);
  const [anchorElCompany, setAnchorElCompany] = React.useState(null);

  const handleServicesClick = (event) => setAnchorElServices(event.currentTarget);
  const handleCompanyClick = (event) => setAnchorElCompany(event.currentTarget);
  const handleClose = () => {
    setAnchorElServices(null);
    setAnchorElCompany(null);
  };

  return (
    <AppBar position="fixed" sx={{ bgcolor: 'primary.main', boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)' }}>
      <Container>
        <Toolbar sx={{ py: 2, justifyContent: 'space-between' }}>
          <Button component={Link} to="/" sx={{ p: 0 }}>
            <Typography variant="h6" sx={{ fontWeight: 800, color: '#FFFFFF', transition: 'color 0.3s ease', '&:hover': { color: '#10B981' } }}>
              Hono Technology
            </Typography>
          </Button>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <Button color="inherit" component={Link} to="/" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Home
            </Button>
            <Button color="inherit" component={Link} to="/explore" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Explore
            </Button>
            <Button color="inherit" component={Link} to="/about" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              About Us
            </Button>
            <Button color="inherit" onClick={handleServicesClick} sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Services
            </Button>
            <Menu anchorEl={anchorElServices} open={Boolean(anchorElServices)} onClose={handleClose}>
              {[
                'App Development', 'Data Engineering & Analysis', 'IT-Resources', 'Full Stack Development',
                'Infrastructure Services', 'Application Management', 'IT Consulting Services', 'IT Security',
                'Testing', 'Mobile Apps', 'Cloud Computing', 'Quality Assurance', 'Offshore Software Development', 'Web Development'
              ].map((service) => (
                <MenuItem
                  key={service}
                  onClick={handleClose}
                  component={Link}
                  to={`/services/${service.toLowerCase().replace(/ & /g, '-').replace(/ /g, '-')}`}
                >
                  {service}
                </MenuItem>
              ))}
            </Menu>
            <Button color="inherit" onClick={handleCompanyClick} sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Company
            </Button>
            <Menu anchorEl={anchorElCompany} open={Boolean(anchorElCompany)} onClose={handleClose}>
              {['About Us', 'Our Goals', 'Our Team', 'Our Philosophy', 'Privacy Policy'].map((item) => (
                <MenuItem
                  key={item}
                  onClick={handleClose}
                  component={Link}
                  to={`/company/${item.toLowerCase().replace(/ /g, '-')}`}
                >
                  {item}
                </MenuItem>
              ))}
            </Menu>
            <Button color="inherit" component={Link} to="/careers" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Careers
            </Button>
            <Button color="inherit" component={Link} to="/blog" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Blog
            </Button>
            <Button color="inherit" component={Link} to="/contact" sx={{ mx: 1, color: '#FFFFFF', '&:hover': { color: '#10B981' } }}>
              Contact
            </Button>
            <Button
              variant="contained"
              color="secondary"
              href="https://zvertexai.com"
              target="_blank"
              sx={{ mx: 1, borderRadius: '20px', px: 3 }}
            >
              Zvertex AI
            </Button>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Header;
